using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class StructureColumnInputModel : Notifier	{		public StructureColumnInputModel()		{					ColumnInNo = "";			ColumnInSize = "";			ColumnInQty = "";			ColumnInRadius = "";			ColumnInSchedule = "";		}				private string _ColumnInNo;		public string ColumnInNo			{				get { return _ColumnInNo; }				set				{					_ColumnInNo = value;					OnPropertyChanged(nameof(ColumnInNo));				}			}				private string _ColumnInSize;		public string ColumnInSize			{				get { return _ColumnInSize; }				set				{					_ColumnInSize = value;					OnPropertyChanged(nameof(ColumnInSize));				}			}				private string _ColumnInQty;		public string ColumnInQty			{				get { return _ColumnInQty; }				set				{					_ColumnInQty = value;					OnPropertyChanged(nameof(ColumnInQty));				}			}				private string _ColumnInRadius;		public string ColumnInRadius			{				get { return _ColumnInRadius; }				set				{					_ColumnInRadius = value;					OnPropertyChanged(nameof(ColumnInRadius));				}			}				private string _ColumnInSchedule;		public string ColumnInSchedule			{				get { return _ColumnInSchedule; }				set				{					_ColumnInSchedule = value;					OnPropertyChanged(nameof(ColumnInSchedule));				}			}			}}